import { all, fork } from 'redux-saga/effects';
import {ADD_POST_REQUEST} from "../reducers/post";

function* watchAddPost() {
  yield takeLatest(ADD_POST_REQUEST, )
}
export default function* userSaga() {
  yield all([
    fork(watchAddPost),
  ])
}
